import styled from 'styled-components';

const CoinInfo = styled.div`
display: flex;
margin: 10px;
background-color: #e3e3e3
`;

const CoinData = styled.div`
display: flex;
margin: 10px;
background-color: #e3e3e3
`;

export default CoinInfo
